pragma solidity >=0.5.0 <0.7.0;
pragma experimental ABIEncoderV2;

import "./AufToken.sol";
import "./AufNFT.sol";

contract AufGame {
    string public name = "Amongus.finance game";
    address public owner;
    AufToken public aufToken;
    AufNFT public aufNFT;
    uint private constant max_players = 10;

    enum Roles { 
        ACTIVE,
        INACTIVE,
        VOTING,
        UNKNOWN,

        IMPOSTOR, 
        CREWMATE
    } 

    enum States {
        ALIVE,
        GHOST
    }

    struct Player {
        States state;
        Roles role;
        address adr;
    }

    Player[max_players] private players;
    Roles[max_players] private roles_;
    Roles private current_stage = Roles.INACTIVE;

    address[max_players] private Users;
    mapping(address => uint) public player_index;
    mapping(string => Roles) public lookup;

    event Log(string _text);
    event Winside(Roles a, string b);
    event CurrentStage(Roles a);

    uint private impostor_count = 3; 
    uint private crewmate_count = 7; 
    uint private hit = 11; 
    uint private voted = 0;
    uint private index = 0;
    uint private bank = 0;
    uint private min_stake = 1000000000000000000000;
    uint public impostor_bets = 0;
    uint public citizen_bets = 0;
    uint[max_players] private voted_already; 
    uint[max_players] private voted_for;
    address burnaddr = 0x000000000000000000000000000000000000000d;

    constructor(AufToken _aufToken, AufNFT _aufNFT) public {
        aufToken = _aufToken;
        aufNFT = _aufNFT;
        owner = msg.sender;
    }

    modifier ActiveGame() {
        require(current_stage != Roles.INACTIVE);
        _;
    }

    modifier ActiveVote() {
        require(current_stage == Roles.VOTING);
        _;
    }

    modifier avaliable() {
        require (
            index < max_players,
            "There are enough players in this game already"
        );
        _;
    }

    modifier full() {
        require (
            index == max_players,
            "There are some more places"
        );
        _;
    }

    function ConnectGame(uint256 nftid) public avaliable() {
        require(aufNFT.ownerOf(nftid) == msg.sender, "You are not owner of this ATICKET ID");
        aufNFT.transferFrom(msg.sender, burnaddr, nftid);
        Users[index] = msg.sender;
        player_index[msg.sender] = index;
        index++;       
    }

    function gameStart() public full() {       
        emit Log("Let's Amongus.finance game begin!");
        for (uint i = 0; i < max_players; i += 1) {
            players[i].state = States.ALIVE;
            players[i].adr = Users[i];
        }
        players[0].role = Roles.IMPOSTOR;
        players[1].role = Roles.IMPOSTOR;
        players[2].role = Roles.IMPOSTOR;
        players[3].role = Roles.CREWMATE;
        players[4].role = Roles.CREWMATE;
        players[5].role = Roles.CREWMATE;
        players[6].role = Roles.CREWMATE;
        players[7].role = Roles.CREWMATE;
        players[8].role = Roles.CREWMATE;
        players[9].role = Roles.CREWMATE;
        lookup["IMPOSTOR"] = Roles.IMPOSTOR;
        lookup["CREWMATE"] = Roles.CREWMATE;
        current_stage = Roles.ACTIVE;
        bank = 0;
        impostor_bets = 0;
        citizen_bets = 0;
    }

    function Bet(uint256 stake) public ActiveGame() {
        require(current_stage == Roles.ACTIVE, "Bets are no longer accepted!");
        require(stake >= min_stake, "Less than min stake"); 
        require(aufToken.balanceOf(msg.sender) >= stake, "Not enough");
        bank += stake;
        uint ind = player_index[msg.sender];
        if (players[ind].role == Roles.IMPOSTOR) {
            impostor_bets += stake;
        } else {
            citizen_bets += stake;
        }
        aufToken.transferFrom(msg.sender, address(this), stake);
    }

    modifier roleChecktoKill(Roles r) {
        bool flag = false;
        for (uint i = 0; i < max_players; i++) {
            if (players[i].adr == msg.sender) {
                if (players[i].role == r && players[i].state == States.ALIVE && current_stage == Roles.ACTIVE) {
                    flag = true; 
                }
                break;
            }    
        }
        require (flag);
        _;
    }

    modifier playerCheck() {
        bool plflag = false;
        for (uint i = 0; i < max_players; i++) {
            if (players[i].adr == msg.sender) {
                if (players[i].state == States.ALIVE) {
                    plflag = true; 
                }
                break;
            }    
        }
        require (plflag);
        _;
    }

    modifier impostor_settled(uint ind) {
        require(ind < max_players && ind >= 3 && players[ind].state == States.ALIVE);
        _;
    }

    function ImpostorKill(uint ind) public roleChecktoKill(Roles.IMPOSTOR) ActiveGame() impostor_settled(ind) {
            hit = ind;
            players[hit].state = States.GHOST;
            crewmate_count--;
            if (crewmate_count == 0) { 
                ImpostorWin();
        }
    }

    function startVoting() public playerCheck() ActiveGame() {
        current_stage = Roles.VOTING;
        emit CurrentStage(Roles.VOTING);
    }

    function voteCount() public view returns (uint) {
        return (impostor_count + crewmate_count);
    } 

    function Vote(uint ind) public playerCheck() ActiveVote() {
        uint vote_count = voteCount();
        if (voted < vote_count && voted_already[player_index[msg.sender]] == 0 && players[ind].state == States.ALIVE) {
            voted_already[player_index[msg.sender]] = 1;
            voted_for[ind] += 1;
            voted++;

        } 
        if (voted == vote_count) {
            uint max = 0;
            uint i_max = 0;
            for (uint i = 0; i < max_players; i++) {
                if (voted_for[i] > max) {
                    max = voted_for[i];
                    i_max = i;
                }
            }
            if (players[i_max].role == Roles.IMPOSTOR) impostor_count--;
            else crewmate_count--;
            players[i_max].state = States.GHOST;

            voted = 0;

            for (uint i = 0; i < max_players; i++) {
                voted_for[i] = 0;
            }
            for (uint i = 0; i < max_players; i++) {
                voted_already[i] = 0;
            }
            current_stage = Roles.ACTIVE;
            emit CurrentStage(Roles.ACTIVE);
        }
        if (crewmate_count == 0) {
            ImpostorWin();
        }
        else if (impostor_count == 0) {
            CrewmateWin();
        } 
    }

    function ImpostorWin() public {
       emit Winside(Roles.IMPOSTOR, ":WIN");
       uint256 count = bank / 3;
       for (uint i = 0; i < 3; i++) {
           aufToken.transfer(Users[i], count);
       }
       Reset();
       return;
    }

    function CrewmateWin() public {
        emit Winside(Roles.CREWMATE, ":WIN");
        uint256 count = bank / 7;
        for (uint i = 3; i < max_players; i++) {
           aufToken.transfer(Users[i], count);
        }
        Reset();
        return;
    }

    function CheckAlive() public view returns(uint) {
        uint count = 0;
        for (uint i = 0; i < max_players; i += 1){
            if(players[i].state == States.ALIVE) count += 1;
        }
        return(count);
    }

    function CheckAlive(uint ind) public view correct_range(ind) returns(uint) {
        uint count = 0;
        if (players[ind].state == States.ALIVE) count = 1;
        return(count);
    }

    function RoleLookup(string calldata s) external view returns (uint[] memory) {
        uint k = 0;
        Roles rr = lookup[s];

        for (uint i = 0; i < max_players; i++) {
            if (players[i].role == rr) k++;
        }

        uint[] memory lookup_arr = new uint[](k);
        k = 0;

        for (uint i = 0; i < max_players; i++) {
            if (players[i].role == rr) {
                lookup_arr[k] = i;
                k++;
            }
        }
        return lookup_arr;
    }

    function Reset() public {
        current_stage = Roles.INACTIVE;
        index = 0;
        voted = 0;
        for (uint i = 0; i < max_players; i++) {
            voted_already[i] = 0;
        }
        for (uint i = 0; i < max_players; i++) {
            voted_for[i] = 0;
        }
        for (uint i = 0; i < max_players; i++) {
            roles_[i] = Roles.UNKNOWN;
        }
        hit = 11;
        impostor_count = 3;
        crewmate_count = 7;
    }

    modifier correct_range(uint ind) {
        require(ind < max_players && ind >= 0 && players[ind].state != States.GHOST);
        _;
    }
}
